import Database from '../../Database';
import { useParams } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faImport, faExport, faGear } from "@fortawesome/free-solid-svg-icons";
import './style.css'



export default function Grades() {
  const { courseId } = useParams();
  const grades = Database.grades.filter((grade) => grade.course === courseId);
  const assignments = Database.assignments.filter((assignment) => assignment.course === courseId);
  const enrollments = Database.enrollments.filter((enrollment) => enrollment.course === courseId);
  const users = Database.users;
  return (<>
    <div class="d-flex flex-row">
      <button type="button" class="btn btn-secondary ms-auto me-2">
        <FontAwesomeIcon icon={faImport} />
        Import
      </button>
      <button type="button" class="btn btn-secondary me-2">
        <FontAwesomeIcon icon={faExport} />
        Export
      </button>
      <button type="button" class="btn btn-secondary">
        <FontAwesomeIcon icon={faGear} />
      </button>
    </div>
  </>);
}
